import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { GenericTable, GenericPopup } from './ReusableReactComponents';
import './AllPages.css';

const CargoForm = ({ cargo, onSave, onClose, cargoCategories }) => {
  // Initialize form state with cargo data if editing, or blank for adding
  const initialState = cargo || {
    customerName: '',
    customerEmail: '',
    cargoLength: '',
    cargoWidth: '',
    cargoHeight: '',
    cargoWeight: '',
    cargoCategory: '',
    cargoHazardous: '',
    cargoValue: '',
    pickupAddress: '',
    deliveryAddress: '',
    deliveryDate: '',
    deliveryStatus: '',
  };

  const [cargoData, setCargoData] = useState(initialState);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setCargoData({ ...cargoData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault(); // Prevent form submission
    try {
      const method = cargo ? 'put' : 'post';
      const url = cargo ? `/api/cargo/${cargo._id}` : '/api/cargo';

      await axios[method](url, cargoData);
      onSave(); // This will close the popup and refresh the list
    } catch (error) {
      console.error('Error saving cargo:', error);
    }
  };

  // Fetch Cargo Categories if not passed as props
  useEffect(() => {
    const fetchCategories = async () => {
      if (!cargoCategories.length) {
        try {
          const response = await axios.get('/api/cargoCategories');
          cargoCategories = response.data; // This might need to be managed differently if cargoCategories is not mutable
        } catch (error) {
          console.error("Error fetching cargo categories", error);
        }
      }
    };

    if (!cargoCategories) {
      fetchCategories();
    }
  }, [cargoCategories]);

  return (
    <>
      {formFieldsConfig.map((field) => (
        <div key={field.name}>
          <label>{field.label}:</label>
          {field.type === 'select' ? (
            <select name={field.name} value={editData[field.name] || ''} onChange={handleChange}>
              {field.options.map((option) => (
                <option key={option.value} value={option.value}>{option.label}</option>
              ))}
            </select>
          ) : (
            <input type={field.type} name={field.name} value={editData[field.name] || ''} onChange={handleChange} />
          )}
        </div>
      ))}
      <button className="popup-ok-btn" onClick={handleSaveClick}>OK</button>
    </>
  );
};

const UnfulfilledCargo = () => {
  const [cargoList, setCargoList] = useState([]);
  const [showCargoPopup, setShowCargoPopup] = useState(false);
  const [currentCargo, setCurrentCargo] = useState(null);
  const [cargoCategories, setCargoCategories] = useState([]);

  useEffect(() => {
    fetchCargo();
    fetchCargoCategories();
  }, []);

  const fetchCargo = async () => {
    try {
      const response = await axios.get('/api/cargo');
      setCargoList(response.data);
    } catch (error) {
      console.error('Error fetching cargo:', error);
    }
  };

  const fetchCargoCategories = async () => {
    try {
      const response = await axios.get('/api/cargoCategories');
      setCargoCategories(response.data);
    } catch (error) {
      console.error('Error fetching cargo categories:', error);
    }
  };

  const handleSaveCargo = async (cargoData) => {
    // Add or update cargo logic here
    setShowCargoPopup(false);
    fetchCargo();
  };

  const deleteCargo = async (id) => {
    try {
      await axios.delete(`/api/cargo/${id}`);
      fetchCargo();
    } catch (error) {
      console.error('Error deleting cargo:', error);
    }
  };

  const columns = [
  { Header: 'Customer Name', accessor: 'customerName' },
  { Header: 'Email', accessor: 'customerEmail' },
  { Header: 'Cargo Length', accessor: 'cargoLength' },
  { Header: 'Cargo Width', accessor: 'cargoWidth' },
  { Header: 'Cargo Height', accessor: 'cargoHeight' },
  { Header: 'Cargo Value', accessor: 'cargoValue' },
  { Header: 'Cargo Weight', accessor: 'cargoWeight' },
  { Header: 'Cargo Category', accessor: 'cargoCategory' },
  { Header: 'Cargo Hazardous', accessor: 'cargoHazardous' },
  { Header: 'Pickup Address', accessor: 'pickupAddress' },
  { Header: 'Delivery Address', accessor: 'deliveryAddress' },
  { Header: 'Delivery Date', accessor: 'deliveryDate' },
  { Header: 'Delivery Status', accessor: 'deliveryStatus' },
    {
      Header: 'Actions',
      Cell: ({ row }) => (
        <>
          <button onClick={() => {
            setCurrentCargo(row.original);
            setShowCargoPopup(true);
          }}>Edit</button>
          <button onClick={() => deleteCargo(row.original._id)}>Delete</button>
        </>
      )
    }
  ];

  return (
    <div>
      <h2>Unfulfilled Cargo</h2>
      <button onClick={() => {
        setCurrentCargo(null);
        setShowCargoPopup(true);
      }}>Add Cargo</button>
      <GenericTable data={cargoList} columns={columns} />
      {showCargoPopup && (
        <GenericPopup show={showCargoPopup} onClose={() => setShowCargoPopup(false)}>
          <CargoForm cargo={currentCargo} onSave={handleSaveCargo} onClose={() => setShowCargoPopup(false)} cargoCategories={cargoCategories} />
        </GenericPopup>
      )}
    </div>
  );
};

export default UnfulfilledCargo;
